import React, { useState } from "react";
import axios from 'axios';

export default function Uploader() {
  const [pbtOptions, setPBTOptions] = useState([])
  const [pbtFile, setPBTFile] = useState()
  const [pbtTableData, setPbtTableData] = useState()
  const [sbcTableData, setSBCTableData] = useState()
  const uploadPBT = (event) => {
    const input = event.target.files[0];
    let data = new FormData()

    data.append('file', input)

    setPBTFile(input)

    let config = {
      method: 'post',
      maxBodyLength: Infinity,
      url: 'http://localhost:3001/plan_names',
      data : data
    };

    axios.request(config)
      .then((response) => {
        setPBTOptions(response.data)
      })
      .catch((error) => {
        console.log(error);
      });
  }

  const uploadSBC = (event) => {
    const input = event.target.files[0];
    let data = new FormData()

    data.append('file', input)

    let config = {
      method: 'post',
      maxBodyLength: Infinity,
      url: 'http://localhost:3001/sbc',
      data : data
    };

    axios.request(config)
      .then((response) => {
        setSBCTableData(response.data)
      })
      .catch((error) => {
        console.log(error);
      });
  }

  const selectPlan = (e) => {
    const pbtOption = pbtOptions.find(pbt => pbt.key === e.target.value)

    let data = new FormData()

    data.append('plan_name', pbtOption.plan_name);
    data.append('sheet_name', pbtOption.sheet_name);
    data.append('file', pbtFile);

    let config = {
      method: 'post',
      maxBodyLength: Infinity,
      url: 'http://localhost:3001/pbt_data',
      data : data
    };

    axios.request(config)
    .then((response) => {
      setPbtTableData(response.data.data)
    })
    .catch((error) => {
      console.log(error);
    });

  }

  return (
    <div className="row">
      <div className="col-4">
        <div className="row">
          <div className="mb-3">
            <label htmlFor="formFile" className="form-label">Upload PBT</label>
            <input className="form-control" type="file" id="formFile" onChange={(e) => uploadPBT(e)} accept="application/vnd.ms-excel.sheet.macroenabled.12" />

            { pbtOptions.length > 0 && 
              <select className="form-select mt-3" aria-label="Default select example" onChange={(e) => selectPlan(e)}>
                <option defaultValue>Select Plan</option>
                { pbtOptions.map(option => <option value={option?.key} key={option?.key}>{option?.plan_name}</option>) }
              </select>
            }

            { pbtTableData &&
              <table className="table table-bordered table-hover mt-3">
                <tbody>
                  {
                    pbtTableData.map((table, index) => {
                      return(
                        <>
                        <tr key={index}>
                          <th colSpan={2} style={{backgroundColor: '#007bc4', color: '#fff'}}>{table?.heading}</th>
                        </tr>
                        { table?.data.map((data, index) => 
                            Object.keys(data).map((d, i) => {
                              return(
                                <>
                                  <tr key={index}>
                                    <th colSpan={2} style={{backgroundColor: '#6c757d', color: '#fff'}}>{d}</th>
                                  </tr>
                                  {
                                    data[d].map(row => {
                                      return Object.keys(row).map((r, i) => {
                                        return(
                                          <tr key={i}>
                                            <th>{r}</th>
                                            <td>{row[r]}</td>
                                          </tr>
                                        )
                                      })
                                    })
                                  }
                                </>
                              )
                            })
                          )}
                        </>
                      )
                    })
                  }
                </tbody>
              </table>
            }


          </div>
        </div>
      </div>
      <div className="col-4">
        <div className="row">
            <div className="mb-3">
              <label htmlFor="formFile" className="form-label">Upload SBC</label>
              <input className="form-control" type="file" id="formFile" onChange={(e) => uploadSBC(e)} accept="application/pdf" />
              { sbcTableData &&
                  <table className="table table-bordered table-hover mt-3">
                    <tbody>
                      {
                        sbcTableData?.results.map((r, index) => {
                          return(
                            <>
                              <tr key={index}>
                                <th colSpan={2} style={{backgroundColor: '#007bc4', color: '#fff'}}>{r["Services You May Need"]}</th>
                              </tr>
                              <tr>
                                <th colSpan={2} style={{backgroundColor: '#6c757d', color: '#fff'}}>In-Network Provider </th>
                              </tr>
                              <tr>
                                <td>{r["In-Network Provider "]}</td>
                              </tr>
                              <tr>
                                <th colSpan={2} style={{backgroundColor: '#6c757d', color: '#fff'}}>Out-of-Network Provider</th>
                              </tr>
                              <tr>
                                <td>{r["Out-of-Network Provider "]}</td>
                              </tr>
                            </>
                          )
                        })
                      }
                    </tbody>
                  </table>
              }
            </div>
          </div>
      </div>
    </div>
  )
}
